Jusqu’ici, vous avez écrit des instructions de style qui s’appliquent à une balise (les mêmes balises ex. <h1> ont un seul et même style). Nous allons voir deux mécanismes supplémentaires portés par les attributs HTML class et id qui permettent d’appliquer des styles différents aux différentes occurrences d’une même balise. Les classes. On définit autant de classes que nécessaires pour la balise concernée et on associe un style à chacune des classes. La notation suivante est adoptée : Code CSS: p.typeA { color: blue; }
p.typeB { color: red; } Code XHTML: <p>Un paragraphe sans style particulier<p>
<p class="typeA">Un paragraphe qui utilise le style défini par p.typeA dans la CSS</p>
<p class="typeB">Un autre qui utile le style défini par p.typeB dans la CSS</p>
<p class="typeA">De nouveau un paragraphe qui utilise le style défini par p.typeA</p>
<p class="typeB">et un paragraphe qui utilise également le style défini par p.typeB</p> Résultat: Un paragraphe sans style particulierUn paragraphe qui utilise le style défini par p.typeA dans la CSSUn autre qui utile le style défini par p.typeB dans la CSSDe nouveau un paragraphe qui utilise le style défini par p.typeAet un paragraphe qui utilise également le style défini par p.typeB Il existe une autre façon de procéder pour permettre l’application de styles différents à une même balise. Il s’agit d’utiliser non pas une classe (attribut class) mais un identifiant (attribut id). Le principe est le même dans les deux cas mais la différence est qu’on utilisera l’attribut class lorsque le style est applicable à plusieurs endroits dans le document alors qu’on utilisera l’attribut id quand le style est spécifique à un endroit particulier dans le document. En conséquence, la valeur d’un id est unique dans le document. Code CSS: p#abc { color: blue; text-align: center;
} p#ident1 { color: green; } Code XHTML: <p>Un paragraphe sans style particulier<p>
<p id="abc">Seul paragraphe utilisant le style défini par p#abc dans la CSS</p>
<p id="ident1">Seul qui utilise le style défini par p#ident1 dans la CSS</p> Résultat: Un paragraphe sans style particulier	Seul paragraphe utilisant le style défini par p#abc dans la CSS	Seul qui utilise le style défini par p#ident1 dans la CSS
